    "#do chloropeth map\n",
    "ax = merged_data.plot(column='Total Count',\n",
    "                      cmap='OrRd',\n",
    "                      figsize=(12,12),\n",
    "                      edgecolor='black',\n",
    "                      legend=True,\n",
